import { useState } from "react";
import { DeleteImg } from "../locales/images/delete";
import { SearchImg } from "../locales/images/search";
import { StartSearchImg } from "../locales/images/startSearch";
import { Filter } from "../models/Filter";
import { CircleBox, SearchMain } from "../styles/Header";
import { Filters } from "./Filters";
import { SearchBar } from "./SearchBar";
export const Search = ({ filter, setFilter, isOpen, setIsOpen }: any) => {
  return (
    <SearchMain>
      <CircleBox
        onMouseEnter={() => setIsOpen(true)}
        onMouseLeave={() => setIsOpen(false)}
      >
        <SearchImg />
      </CircleBox>
      <SearchBar
        onMouseEnter={() => setIsOpen(true)}
        onMouseLeave={() => setIsOpen(false)}
      ></SearchBar>
      <Filters filter={filter} setFilter={setFilter}></Filters>
    </SearchMain>
  );
};
